import React from 'react';
import data from './post.json';
import { Route, Switch, Link } from 'react-router-dom';
import Web from './Web'
import Form from './Form'
var element = data;

class Data extends React.Component {
    constructor() {
        super()
        this.state = {
            array: []
        }
    }
    componentDidMount() {
        element.map((emp) =>
        (
            this.setState({ array: emp })
        ))
    }

    render() {
        return (

            element.map((emp, i) =>
            (   <table>
                  <tr>
                <th>UserID</th>
                <th>ID</th>
                <th>Title</th>
              </tr>
              <tr>
                    <td>{emp.userId}</td>
                    <td>{emp.id}</td>

                    <Switch>
                      <Route path="/">
                      <td ><Link to={'/Web/' + emp.id} > {emp.title}</Link></td>
                      </Route>
                      <Route path="/form" component={Form}></Route>
                    </Switch>
                  </tr>


                </table>

            ),
            )

        )

    }
}
export default Data;
